        <div>
          <nav class="navbar navbar-dark bg-dark">
           <Link to="/homepage"> <button>Homepage </button></Link>
           <h3 style={{color:'white'}}> welcome back {user.name} </h3>
          <Link to="/login"><button id="html"><span id="htmltxt">Login</span></button></Link>
          <Link to="/signup"><button id="html"><span id="htmltxt">Signup</span></button></Link>
          </nav>
        </div>
     );
}
 
